	window._mfq = window._mfq || [];
	
	function submitForm() {

		var frm = $('#inf_f');
		window._mfq.push(['formSubmitAttempt', '#inf_f']);
		$('#inf_e').html('<p><strong class="txt_c_1">Bezig met versturen</strong></p><div class="spcr_v px12"></div>');
		frm.hide();
		$.ajax({
			type: frm.attr('method'),
			url: '/views/ml_snd_inf.php',
			data: frm.serialize(),
			success: function (data) {
                // console.log(data);
				var output = $.parseJSON(data);
				frm.show();
				if (output.valid === false) {
					//ga('send','event','Formulier', 'Foutmelding', output.error, 1);
					$('#inf_e').html('<p><strong class="txt_c_2">' + output.error + '</strong></p><div class="spcr_v px12"></div>');
					window._mfq.push(['formSubmitFailure', '#inf_f']);
					grecaptcha.reset();
				} else {
					$('#inf_f').remove();
					//ga('send','event','Formulier', 'Verzonden', output.success, 1);
					$('#inf_e').html('<p><strong class="txt_c_2">' + output.success + '</strong></p>');
					window._mfq.push(['formSubmitSuccess', '#inf_f']);
				}
			}
		});
		// ev.preventDefault();
	}
	

	function resizeend() {
		if (new Date() - rtime < delta) {
			setTimeout(resizeend, delta);
		} else {
			timeout = false;
			var window_height = $(window).innerHeight()-128;
			$('.sub_menu').css('max-height',window_height+'px');
			
			if(window.innerWidth > 1023){
				$('div[data-original-large]').each(function(index, element) {
					var oldUrl = $(this).css('background-image').replace(/^url\(['"]?/,'').replace(/['"]?\)$/,'');
					if(oldUrl!==null && oldUrl!='none'){
						$(this).css('background-image','url('+$(this).attr('data-original-large')+'), url("'+oldUrl+'")').attr('set_l_img','set');
					}else{
						$(this).css('background-image','url('+$(this).attr('data-original-large')+')').attr('set_l_img','set');
					}
					$(this).removeAttr('data-original-large');
				});
			}else{
				$('div[data-original-medium]').each(function(index, element) {
					var oldUrl = $(this).css('background-image').replace(/^url\(['"]?/,'').replace(/['"]?\)$/,'');
					if(oldUrl!==null && oldUrl!='none'){
						$(this).css('background-image','url('+$(this).attr('data-original-medium')+'), url('+oldUrl+')').attr('set_l_img','set');
					}else{
						$(this).css('background-image','url('+$(this).attr('data-original-medium')+')').attr('set_l_img','set');
					}
					$(this).removeAttr('data-original-medium');
				});
			}
		}
		if(window.innerWidth < 1024){
			headerHeightStart = 100;
		}
		if(window.innerWidth > 1023){
			headerHeightStart = 240
		}
		
		$(window).scroll();	
	}
	
